(17, 1, '2021-09-04 12:43:07', '2021-09-04 12:43:07', '<ul>\r\n 	<li>\r\n<h2>Welcome to My First Episode</h2>\r\n&nbsp;\r\n\r\n<a href=\"http://localhost/podcast3/podcast/first-episode/\">September 4, 2021</a>\r\n<a href=\"http://localhost/podcast3/author/admin/\">admin</a>\r\nKhwopa Show\r\n00:03:163 mb <a href=\"http://localhost/podcast3/podcast/first-episode/#respond\">0 Comments</a>The is my very first podcast episode. I hope you enjoy it. Thank you for listening.\r\n\r\n<!-- [if lt IE 9]><![endif]-->\r\n<audio id=\"audio-6-1\" style=\"width: 100%;\" preload=\"none\" controls=\"controls\"><source type=\"audio/mpeg\" src=\"http://localhost/podcast3/podcast-player/6/first-episode.mp3?_=1\" /><a href=\"http://localhost/podcast3/podcast-player/6/first-episode.mp3\">http://localhost/podcast3/podcast-player/6/first-episode.mp3</a></audio>\r\n\r\n<aside><a title=\"Welcome to My First Episode \" href=\"http://localhost/podcast3/podcast-download/6/first-episode.mp3?ref=download\">Download file</a> | <a title=\"Welcome to My First Episode \" href=\"http://localhost/podcast3/podcast-download/6/first-episode.mp3?ref=new_window\" target=\"_blank\" rel=\"noopener\">Play in new window</a> | Duration: 00:03:16\r\n\r\n</aside><!-- close .slider-content-max-width -->\r\n<!-- close .slider-text-floating-container -->\r\n<!-- close .slider-elements-display-table -->\r\n<!-- close .secondline-elements-slider-background --></li>\r\n</ul>\r\n<!-- #-elements-secondline-flexslider-2e7dba66 -->\r\n<!-- close .secondline-themes-post-slider-main -->\r\n<h2>Subscribe To My Podcast</h2>\r\nWhen, while the lovely valley teems with vapour around me, and the meridian sun strikes the upper surface of the impenetrable foliage of my trees, and but a few stray.\r\n\r\nSteal into the inner sanctuary, I throw myself down among the tall grass by the trickling stream and, as I lie close to the earth, a thousand unknown plants are noticed by me.\r\n\r\n<a role=\"button\" href=\"#\">\r\nSubscribe\r\n</a>\r\n<a role=\"button\" href=\"#\">\r\nLearn More\r\n</a>\r\n<h2>Join Thousands of Listeners Worldwide</h2>\r\nWhen, while the lovely valley teems with vapour around me, and the meridian sun strikes the upper surface of the impenetrable foliage of my trees, and but a few stray.\r\n\r\nSteal into the inner sanctuary, I throw myself down among the tall grass by the trickling stream and, as I lie close to the earth, a thousand unknown plants are noticed by me.\r\n\r\nWhen I hear the buzz of the little world among the stalks, and grow familiar with the countles\r\n\r\n<img title=\"\" src=\"http://localhost/podcast3/wp-content/plugins/elementor/assets/images/placeholder.png\" alt=\"\" />', 'The Khwopa Show', '', 'publish', 'closed', 'closed', '', 'the-khwopa-show', '', '', '2021-10-27 09:46:06', '2021-10-27 09:46:06', '', 0, 'http://localhost/podcast3/?page_id=17', 0, 'page', '', 0),
