(92, 1, '2021-10-29 07:34:03', '2021-10-29 07:34:03', '', 'Banner01', '', 'inherit', 'open', 'closed', '', 'banner01', '', '', '2021-10-29 07:34:03', '2021-10-29 07:34:03', '', 41, 'http://localhost/podcast3/wp-content/uploads/2021/10/Banner01.jpg', 0, 'attachment', 'image/jpeg', 0),
(93, 1, '2021-10-29 07:34:09', '2021-10-29 07:34:09', '<img class=\"alignnone size-full wp-image-92\" src=\"http://localhost/podcast3/wp-content/uploads/2021/10/Banner01.jpg\" alt=\"\" width=\"1140\" height=\"300\" />\r\n\r\nKhwopa is the prehistoric name of Bhaktapur, the abode of art and culture. Bhaktapur municipality is a pioneer to establish higher educational institutes by local governments in Nepal. Khwopa (Higher) Secondary School, established in 1999 A.D (2056 B.S.), was the first academic institute established by Bhaktapur Municipality. Within two decades, Bhaktapur municipality has succeeded in establishing seven higher educational institutions.\r\n\r\nThese academic institutions are initiated with the vision of establishing Bhaktapur as the center of excellence thereby intellectualizing the entire society. The institutions aim to provide graduates, dedicated to the country and people, with sound theoretical and practical knowledge, competence and skill. All these institutions follow the policy of making quality higher education with an affordable fee, accessible to people from economically common strata of the society.\r\n\r\nWithin a short period of establishment, these academic institutes placed themselves among the most influential academic institutions in the country. The colleges are well driven ahead by wise management, competent and enthusiastic academic faculty, sound physical and academic infrastructure, being strongly backed by the people of Bhaktapur.\r\n\r\nIn particular, Khwopa Engineering College (KhEC), Nepal\'s first community-based engineering college, was established in 2001 A.D. (2058 B.S.) in affiliation with highly esteemed Purbanchal University, Nepal. KhEC conducted Bachelor in Civil Engineering (4 Years) and Architecture (5 Years) from 2001, BE in Computer Engineering from 2002 and BE in Electronics and Communication Engineering from 2003. Accordingly, KhEC conducted ME in Earthquake Engineering from 2005 and MSc in Urban Design and Conservation from 2006.\r\n\r\nKhEC has been an attractive destination for students who aspire to become competent engineers and architects. KhEC is proud to share the fact that, it has served people/students from all districts of Nepal.\r\n\r\nEngineering has a role among many to conserve and improve the indigenous, traditional technologies and materials by blending indigenous and modern-day technologies. Towards this end, KhEC, in addition to academic activities, has been conducting research works including traditional architecture, archaeological structures and indigenous know-how through professors and lecturers alone or combined with students\' project works.\r\n\r\nBacked and guided by experienced professors and invitee subject experts and lecturers, KhEC is moving forward to achieve its missions. It is assumed that the goals are well materialized since regular classes, in-depth practical assignments, field studies, excursions and report writing and internal examinations which are recipes for the success of every student, are carefully managed.\r\n\r\nKhEC has been felicitated as the best college among affiliated colleges by the Purbanchal University in 2076 at the occasion of the 26<sup>th</sup>annual function and closing ceremony of the silver jubilee.', 'About', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2021-10-29 07:34:09', '2021-10-29 07:34:09', '', 41, 'http://localhost/podcast3/?p=93', 0, 'revision', '', 0),
(95, 1, '2021-10-29 07:49:36', '2021-10-29 07:49:36', 'Talking about the teachers in khec !', 'Fourth Podcast in khec', '', 'publish', 'open', 'closed', '', 'fourth-podcast-in-khec', '', '', '2021-10-29 08:00:53', '2021-10-29 08:00:53', '', 0, 'http://localhost/podcast3/?post_type=podcast&#038;p=95', 0, 'podcast', '', 0),
(96, 1, '2021-10-29 08:02:42', '2021-10-29 08:02:42', '<div class=\"episodePage_textContent__2t9Kt\">\r\n<div>\r\n\r\nWith his versatility, rigor, and humor, Sandip Chhetri has won the hearts of many. Mostly known for his humorous presentation in What the Flop, the media personality has proven his capabilities in the big screen as well. In this episode, this amazing artist joined us to share not only his perspective on several socio-political aspects of the country, but also his own life, all the while adding humor to it.\r\n\r\n</div>\r\n</div>\r\n<div class=\"episodePage_buttonContent__3atda\"></div>', 'Sandip Chhetri and Khec', '', 'publish', 'open', 'closed', '', 'sandip-chhetri-and-khec', '', '', '2021-11-26 12:47:16', '2021-11-26 12:47:16', '', 0, 'http://localhost/podcast3/?post_type=podcast&#038;p=96', 0, 'podcast', '', 1),
