(99, 1, '2021-11-26 12:34:43', '2021-11-26 12:34:43', 'Justifying with hard work and firm determination, anything is possible, the skipper of our National Football Team, Kiran Chemjong has been an absolute fan favorite over the years. Chemjong with his extraordinary goalkeeper skills have helped Nepali team push through in several international leagues. In this episode, we have this amazing athlete tell us what it is like to be an athlete in Nepal, along with his personal stories, never heard before!', 'Kiran Chemjong and Khec', '', 'publish', 'open', 'closed', '', 'kiran-chemjong-and-khec', '', '', '2021-11-26 12:34:43', '2021-11-26 12:34:43', '', 0, 'http://localhost/podcast3/?post_type=podcast&#038;p=99', 0, 'podcast', '', 0),
